    type: property
    summary: |-
      Indique si n’importe quelle propriété sous le nom donné a été modifiée lors de l’énumération.
      S’il existait une modification, cette valeur de propriété est false.
    optional: true
    syntax:
      content: 'isConsistent?: undefined | false | true'
      return:
